        </div>
        <div className="flex-auto basis-1/2 hover:underline-offset-auto">
          <input
            className="sr-only peer "
            type="radio"
            name="answer"
            value="Teams"
            id="answer_teams"
            // onClick={handleClick}
          />
          <label
            for="answer_teams"
            className="peer-checked:border-green-500 peer-checked:border-2"
          >
            Teams
          </label>
        </div>
      </nav>
    </div>
  );
}

export default Search;
